{
  "env": {
    "browser": true,
    "node": true
  },
  "extends": [
    "eslint:recommended",
    "plugin:@typescript-eslint/eslint-recommended",
    "plugin:import/recommended",
    "plugin:react/recommended",
    "plugin:@typescript-eslint/recommended"
  ],
  "parser": "@typescript-eslint/parser",
  "parserOptions": {
    "ecmaFeatures": { "jsx": true },
    "ecmaVersion": 2015,
    "project": true,
    "sourceType": "module"
  },
  "plugins": ["@typescript-eslint", "import", "react"],
  "rules": {
    "valid-jsdoc": [
      2,
      { "requireReturnType": false, "requireParamType": false }
    ],
    "react/no-is-mounted": [0]
  },
  "settings": {
    "import/ignore": ["react-native"],
    "import/resolver": {
      "typescript": { "extensions": [".js", ".ts", ".tsx"] }
    },
    "react": { "version": "detect" }
  },
  "overrides": [
    {
      "files": ["**/*.{ts,tsx,cts}"],
      "extends": [
        "eslint:recommended",
        "plugin:import/recommended",
        "plugin:react/recommended",
        "plugin:react/jsx-runtime",
        "plugin:@typescript-eslint/recommended"
      ],
      "rules": {
        "@typescript-eslint/ban-ts-comment": [0],
        "@typescript-eslint/no-redeclare": [2],
        "@typescript-eslint/no-explicit-any": [0],
        "@typescript-eslint/no-unused-vars": [0],
        "@typescript-eslint/ban-types": [0],
        "react/display-name": [0],
        "react/jsx-no-undef": [2],
        "react/jsx-uses-react": [1],
        "react/jsx-wrap-multilines": [2],
        "react/no-string-refs": [0],
        "@typescript-eslint/consistent-type-imports": [
          2,
          { "fixStyle": "separate-type-imports" }
        ],
        "@typescript-eslint/consistent-type-exports": [2],
        "valid-jsdoc": [
          2,
          { "requireReturnType": false, "requireParamType": false }
        ],
        "react/no-is-mounted": [0]
      }
    },
    {
      "files": ["**/test/**/*.{ts,tsx}"],
      "parserOptions": { "project": true }
    }
  ]
}

{
  "semi": false,
  "singleQuote": true,
  "tabWidth": 2
}

{
  "hooks": {
    "after:bump": "yarn && git add -u"
  },
  "git": {
    "tagName": "v${version}"
  }
}

{
  // For building the library.
  "extends": "./tsconfig.base.json",
  "compilerOptions": {
    "emitDeclarationOnly": true,
    "outDir": "dist",
    "rootDir": "./src"
  },
  "include": ["src"]
}

{
  // For general development and intellisense.
  // Scans the entire source code against the current TS version
  // we are using during development.
  "extends": "./tsconfig.test.json",
  "compilerOptions": {
    "allowJs": true,
    "checkJs": true,
    "rootDir": "."
  },
  "include": ["."],
  "exclude": ["dist*", "examples", "website"]
}

{
  // For runtime and type tests during CI.
  "extends": "./tsconfig.base.json",
  "compilerOptions": {
    "jsx": "react-jsx",
    "noEmit": true,
    "noImplicitReturns": false
  },
  "include": ["test/typetests"]
}

import fs from 'node:fs/promises'
import path from 'node:path'
import type { Options } from 'tsup'
import { defineConfig } from 'tsup'

async function writeCommonJSEntry() {
  await fs.writeFile(
    path.join('dist/cjs/', 'index.js'),
    `'use strict'
if (process.env.NODE_ENV === 'production') {
  module.exports = require('./react-redux.production.min.cjs')
} else {
  module.exports = require('./react-redux.development.cjs')
}`,
  )
}

const tsconfig = 'tsconfig.build.json' satisfies Options['tsconfig']

export default defineConfig((options): Options[] => {
  const commonOptions: Options = {
    entry: {
      'react-redux': 'src/index.ts',
    },
    sourcemap: true,
    clean: true,
    target: ['esnext'],
    tsconfig,
    ...options,
  }

  return [
    // Standard ESM, embedded `process.env.NODE_ENV` checks
    {
      ...commonOptions,
      name: 'Modern ESM',
      format: ['esm'],
      outExtension: () => ({ js: '.mjs' }),
    },
    {
      ...commonOptions,
      name: 'ESM for RSC',
      entry: {
        rsc: 'src/index-rsc.ts',
      },
      format: ['esm'],
      outExtension: () => ({ js: '.mjs' }),
      dts: false,
    },

    // Support Webpack 4 by pointing `"module"` to a file with a `.js` extension
    // and optional chaining compiled away
    {
      ...commonOptions,
      name: 'Legacy ESM, Webpack 4',
      entry: {
        'react-redux.legacy-esm': 'src/index.ts',
      },
      target: ['es2017'],
      format: ['esm'],
      outExtension: () => ({ js: '.js' }),
    },

    // Meant to be served up via CDNs like `unpkg`.
    {
      ...commonOptions,
      name: 'Browser-ready ESM',
      entry: {
        'react-redux.browser': 'src/index.ts',
      },
      platform: 'browser',
      env: {
        NODE_ENV: 'production',
      },
      format: ['esm'],
      outExtension: () => ({ js: '.mjs' }),
      minify: true,
    },
    {
      ...commonOptions,
      name: 'CJS Development',
      entry: {
        'react-redux.development': 'src/index.ts',
      },
      env: {
        NODE_ENV: 'development',
      },
      format: ['cjs'],
      outDir: './dist/cjs/',
      outExtension: () => ({ js: '.cjs' }),
    },
    {
      ...commonOptions,
      name: 'CJS production',
      entry: {
        'react-redux.production.min': 'src/index.ts',
      },
      env: {
        NODE_ENV: 'production',
      },
      format: ['cjs'],
      outDir: './dist/cjs/',
      outExtension: () => ({ js: '.cjs' }),
      minify: true,
      onSuccess: async () => {
        await writeCommonJSEntry()
      },
    },
    {
      ...commonOptions,
      name: 'CJS Type definitions',
      format: ['cjs'],
      dts: { only: true },
    },
  ]
})

import { defineConfig } from 'vitest/config'

export default defineConfig({
  test: {
    environment: 'jsdom',
    setupFiles: ['test/setup.ts'],
    globals: true,
    alias: {
      'react-redux': new URL(
        process.env.TEST_DIST ? 'node_modules/react-redux' : 'src/index.ts',
        import.meta.url,
      ).pathname,
      // this mapping is disabled as we want `dist` imports in the tests only to be used for "type-only" imports which don't play a role for jest
      '@internal': new URL('src', import.meta.url).pathname,
    },
  },
})
